import { Component } from '@angular/core';


@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {

  // isDisabled = false;

  // color = 'black';



  name = "";

   surname = "";

   Gender :string = 'Male';


//   user: User = {
//     name: "nitin",
//     surname: "Me"
//   };


  submit(): void {
    console.log(`Customer Name is : ${this.name} ${this.surname}  and his Gender is :${this.Gender}`);

    setTimeout(() => {
      alert(`Submited with: ${this.name} ${this.surname}`);
    },1000);

  }





store(name:string){
   if(name==='shashank'){
    alert("Hey There")
   }
}

}





